    return (
        <div>
            <h3>Noch zu erledigen</h3>
            <ul>
                <li>Kochen</li>
                <li>Geschenken besorgen</li>
                <li>Geschenken einpacken</li>
                <li>Putzen</li>
            </ul>
        </div>
    )
}

export default AufgabenListe;
